        [Test]
        public void MergeTwoTriangles_ReturnsOneQuad()
        {
            var go = GameObject.CreatePrimitive(PrimitiveType.Quad);

            var graph = new Graph(go.GetComponent<MeshFilter>().sharedMesh, go.transform);
            graph.DecimateEdges();

            Assert.AreEqual(4, graph.Edges.Count);
            Assert.AreEqual(1, graph.Faces.Count);
            Assert.AreEqual(4, graph.Vertices.Count);
        }

        [Test]
        public void MergeFourTriangles_ReturnsOneQuad()
        {
            var go = GameObject.CreatePrimitive(PrimitiveType.Quad);

            var combineInstances = new List<CombineInstance>();
            combineInstances.Add(new CombineInstance
            {
                mesh = go.GetComponent<MeshFilter>().sharedMesh,
                transform = Matrix4x4.TRS(Vector3.right * 0.5f + Vector3.up * 0.5f, Quaternion.identity, Vector3.one)
            });
            combineInstances.Add(new CombineInstance
            {
                mesh = go.GetComponent<MeshFilter>().sharedMesh,
                transform = Matrix4x4.TRS(Vector3.right * 1.5f + Vector3.up * 0.5f, Quaternion.identity, Vector3.one)
            });

            var colliderMesh = new Mesh
            {
                indexFormat = IndexFormat.UInt32
            };
            colliderMesh.CombineMeshes(combineInstances.ToArray());

            var graph = new Graph(colliderMesh, go.transform);
            graph.DecimateEdges();
            graph.DecimateVertices();

            Assert.AreEqual(4, graph.Edges.Count);
            Assert.AreEqual(1, graph.Faces.Count);
            Assert.AreEqual(4, graph.Vertices.Count);
        }


