        [Test]
        public void Join32Triangles_Returns25Vertices()
        {
            var go = QuadGenerator.CreatePlaneOfTries(4, 4, out var colliderMesh);

            var graph = new Graph(colliderMesh, go.transform);

            Assert.AreEqual(56, graph.Edges.Count);
            Assert.AreEqual(32, graph.Faces.Count);
            Assert.AreEqual(25, graph.Vertices.Distinct().Count());
        }

        [Test]
        public void Join32TrianglesAndOneDuplicate_Returns25Vertices()
        {
            var anotherQuad = QuadGenerator.CreateQuad(GameObject.CreatePrimitive(PrimitiveType.Quad), 2, 2);
            var go = QuadGenerator.CreatePlaneOfTries(4, 4, out var colliderMesh, new List<CombineInstance>
            {
                anotherQuad
            });

            var graph = new Graph(colliderMesh, go.transform);

            Assert.AreEqual(56, graph.Edges.Count);
            Assert.AreEqual(34, graph.Faces.Count);
            Assert.AreEqual(25, graph.Vertices.Distinct().Count());
        }

