        [Test]
        public void OptimizedMesh_ReturnsQuadMesh()
        {
            var go = QuadGenerator.CreatePlaneOfTries(8, 8, out var colliderMesh);

            var graph = new Graph(colliderMesh, go.transform);
            graph.DecimateEdges();
            graph.DecimateVertices();
            var finalMesh = graph.ToMesh();

            Assert.AreEqual(4, finalMesh.vertices.Length);
            Assert.AreEqual(6, finalMesh.triangles.Length);
        }

